(6, 'No irregularity noted', 1, 263, '2014-12-04 15:56:38', '2014-12-04 15:56:38'),
(7, 'Dual Employment:\n(i) From January 2014 Maria has been working for NOFOTA as a full time employee.\n(ii) Between 03 Oct 2014  to 03 Dec 2014, she  also worked for CMI/REPOA as Consultant', 2, 329, '2017-11-14 07:39:52', '2015-01-14 13:16:27'),
(8, 'The candidate alleged that he graduated in 1996, but from the institution verification, it appeared that the candidate graduated on the 5th of July 1997.', 2, 335, '2015-02-27 05:15:49', '2015-02-18 16:35:25'),
(9, '1. The candidate acquired Diploma in International and Youth studies in 2004. But he failed to provide certificate awarded for verification as well as could not indicate duration of the course.\n\n<br>2. From Sept 2011 to June/Oct 2012, he was studying at the University of Dar Es Salaam and same time studying at Open University of Tanzania. Certificate obtained at University of Dar Es Salaam was not availed for verification.', 2, 359, '2015-04-20 02:30:10', '2015-04-20 02:30:10'),
