(19, 'From 2005  he was working in different companies at same time studying.', 1, 595, '2016-10-07 10:43:16', '2016-10-07 10:43:16'),
(20, 'The Candidate stated that he went to \'Tanganyika Law School - Council of Legal Education\' but the correct institution is \'The Law School of Tanzania\'', 1, 1291, '2017-03-23 14:06:18', '2017-03-23 14:06:18'),
(21, 'While the candidate was taking Bachelor of Laws at the University of Dar es salaam in 2004 - 2009, she was also taking her Degree in International Business in Haaga Helia University in 2007 - 2008. She however resigned her studies at Haaga Helia after the first year where she was awarded a Diploma in International Business.', 1, 1297, '2017-05-19 20:54:57', '2017-04-28 18:32:18'),
(22, 'The Candidate has never employed , since she completed her Masters Degree at Norwegian University,', 2, 1413, '2017-07-13 14:04:02', '2017-07-13 13:54:51'),
(23, 'No irregularity noted', 1, 1407, '2017-08-01 13:00:19', '2017-07-13 14:10:53'),
(24, 'THE CANDIDATE DID NOT CLEARLY WRITE ON HIS CV THAT HE WORKED WITH TEMBO QUARRY MINE AS A TEMPORARY EMPLOYEE AS HE MENTIONED IN OTHER WORK EXPERIENCE  LIKE NORTH MARA GOLD MINE AND ATHI RIVER MINE WHERE HE MENTIONED HE WAS JUST AN FIELD TRAINEE', 1, 1619, '2017-11-10 20:09:56', '2017-11-10 20:09:56'),
(25, 'SHE WORKED WITH DAR ES SALAAM INSTITUTE OF TECHNOLOGY FROM 2010 TO 2015 THEN SHE SHE WENT FOR HER STUDIES AT NORWEGIAN UNIVERSITY FROM 2015 TO 2017. AFTER HER STUDIES, SHE WENT BACK TO DAR ES SALAAM INSTITUTE OF TECHNOLOGY TO CONTINUE WITH HER JOB\nSHE IS CURRENTLY WORKING FOR DAR ES SALAAM INSTITUTE OF TECHNOLOGY.', 2, 1625, '2017-11-10 20:19:22', '2017-11-10 20:19:22'),
