INSERT INTO `screening` (`id`, `package_id`, `name`, `description`, `cost`, `short_name`, `form`, `created_at`, `updated_at`) VALUES
(1, 1, 'ID Document Check', 'Verification of machine-readable passport details. Compares the\r\ncodes built in to the passport with the identity details provided by\r\nthe candidate. A good quality photocopy of the relevant ID page,\r\nshowing the machine readable algorithm is required.', '', 'idcheck', 'idcheck', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(2, 1, 'Employment Historyand References', 'Confirmation of employment history from the appropriate\r\nHR/Personnel departments. We will attempt to confirm any periods\r\nof self-employment with the individuals accountant, or other\r\npresentation of evidence, e.g. tax return.', '', 'emphistory', 'employeehistory', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(3, 1, 'Gap Analysis', 'Gaps greater than three months will be investigated directly with\r\nthe candidate and supporting documentation will be obtained and\r\ndetailed in the final report', '', 'gapanalysis', 'gapanalysis', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(4, 1, 'Academic Qualifications', 'Confirmation at source of all higher/tertiary education, irrespective\r\nof when attained.\r\nSecondary/High school education will be confirmed if attainted\r\nwithin the last 5 years.', '', 'academic', 'academic', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(5, 1, 'Professional Qualifications', 'Confirmation of professional qualifications/trade memberships,\r\nincluding levels and dates of affiliation.', '', 'professional', 'professional', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(6, 1, 'CV Analysis', 'Comparison of Candidate CV against completed application form\r\ncovering the term of the SLA period. Discrepancies (in accordance\r\nwith the discrepancy matrix) will be reported via Contractorâ€™s on-\r\nline reporting tool.', '', 'cvanalysis', 'cvnalysis', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(7, 2, 'Criminal Check', 'A check to identify criminal convictions and adverse information in\r\nrelation to the candidate.', '', 'criminal', 'criminal', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(8, 2, 'Adverse Media Search', 'Extensive searches made of major broadsheets and periodicals\r\ncovering a six-year period for any contributions an individual may\r\nhave made or articles they may have been quoted in or the subject\r\nof. Only negative articles will be reported.', '', 'adverse', 'adversemedia', '2014-11-22 09:09:46', '2014-11-22 09:09:46'),
(9, 2, 'Compliance Database Check', 'A search of international databases for individuals subject to\r\nregulatory sanctions or enforcements, known terrorists, money\r\nlaunderers, fraudsters, politically exposed persons (PEPs) and\r\nblack-listed persons. This search is an â€˜exact matchâ€™ name check', '', 'complaince', 'compliance', '2014-11-22 09:09:46', '2014-11-22 09:09:46');
